import React from 'react'
import './style.css'

export default class Login extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      userID: '',
      username: '',
      password: ''
    }
  }

  componentDidMount() {

  }
  render() {
    return (
      <div className="login">
        <div className="input-wrap">
          <label htmlfor="user" className="input-title">用户名</label>
          <input id="user" className="input" />
        </div>
        <div className="input-wrap">
          <span htmlfor="password" className="input-title">密码</span>
          <input id="password" className="input" />
        </div>
      </div>
    )
  }
}
